import AddGroup from "./AddGroup";
import { Input, TextArea, FormBtn } from "../../components/Form";

const ServiceMenu = () => (
    <Container>
        <Row>
            <Col size="md-6">
                <Card>
                </Card>
            </Col>
            <Col size="md-6">
                <Card>
                    <form>
                        <Input
                            value={this.state.groupName}
                            onChange={this.handleInputChange}
                            name="groupName"
                            placeholder="Add New"
                        />

                    </form>


                </Card>
            </Col>
        </Row>

    </Container >

);

export default ServiceMenu;
